import React from 'react'

const getButtonStyle = name => {
    const clsName = {
        '=': 'equalSign',
        '*': 'operationSigns',
        '/': 'operationSigns',
        '+': 'operationSigns',
        '-': 'operationSigns',
    }
    return clsName[name];
}

const Button = ({value, key}) => {
  return (
    <button className={`${getButtonStyle(value)} buttonValue`}>{value}</button>
  )
}

export default Button
